import React from 'react';


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      list: [{name:'sanjana'},
      {name:'manish'},
      {name:'abhijeet'}],
    };
  }
  render() {
    return (
      <div>
        <ul>
          {this.state.list.name.map(item => (
            <li key={item}>{item}</li>
          ))}
        </ul>

      </div>
    );
  }
}
export default App;
